import React from 'react';
import { Jumbotron as Jumbo, Container } from 'react-bootstrap';
import styled from 'styled-components';

const Styles = styled.div`
  .jumbo {
    background-size: cover;
    color: #efefef;
    position: relative;
    z-index: -2;
    margin: 2.5vh;
    height: 10vh;
    display: flex;
    align-items: center;
  }

  #about {
    background-color: #91A;
  }

  .overlay {

    opacity: 0.3;
    position: absolute;
    top: 0;
    left: 0;
    bottom: 0;
    right: 0;
    z-index: -1;
  }
`

export const AboutJumbotron = () => (
  <Styles>
    <Jumbo fluid id="about" className="jumbo">
      <div className="overlay"></div>
      <Container className="slideLeft">
        <h1>About</h1>
      </Container>
    </Jumbo>
  </Styles>
)

export const ExperiencesJumbotron = () => (
  <Styles>
    <Jumbo fluid id="about" className="jumbo">
      <div className="overlay"></div>
      <Container className="slideLeft">
        <h1>Experiences</h1>
      </Container>
    </Jumbo>
  </Styles>
)
